import HomeView from '../views/HomeView.vue'
import Detach from '../views/Detach.vue'


Vue.use(VueRouter)

const routes = [
  {
    path: '/',
    name: 'home',
    component: HomeView
  },
  {
    path: '/browse',
  name: 'Browse',
  component: Browse
  },
]

const router = new VueRouter({
  mode: 'history',
  base: process.env.BASE_URL,
